import Log from "../images/file.png"

function navbar() {
    return (
        <div class="bg-navbar text-white w-full p-4 text-center">
            <div class="max-w-screen-sm mx-auto flex justify-between p-4">
                <h1 class="text-2xl">เช็คเวลาเปิดปิดน้ำ</h1>
                <button class="rounded p-2 bg-red-600">
                    <img class="w-6" src={Log} alt="log"/>
                </button>
            </div>
            
        </div>
        
        );
}

export default navbar;
